import React, { Component } from 'react';
import Img from 'react-image'

class Container extends Component {

    render() {

        console.log(this.props.img);

        const myComponent = () =>
            <Img
                src={[this.props.img]}
                loader={'loading'}
            />

        return (
            <div id="main-container">
                {myComponent}

            </div>
        );
    }
}

export default Container;
